import './checkout.css'

const CheckOut = () => {
    return (
        <>
        <div className="container">
        Спасибо за покупку!
        Чек отправлен на вашу почту!
        <button>Вернуться на сайт</button>
        </div>
        </>
    )
}

export default CheckOut;
